pragma solidity ^0.8.20;

import {IERC721Metadata} from "@openzeppelin/contracts/interfaces/IERC721Metadata.sol";
import {OwnableUpgradeable} from "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import {ERC165Upgradeable} from "@openzeppelin/contracts-upgradeable/utils/introspection/ERC165Upgradeable.sol";

import {SBT} from "@solarity/solidity-lib/tokens/SBT.sol";

import {IVerifiedSBT} from "./interfaces/IVerifiedSBT.sol";

contract VerifiedSBT is IVerifiedSBT, SBT, OwnableUpgradeable, ERC165Upgradeable {
    uint256 public override nextTokenId;

    function init(
        string calldata name_,
        string calldata symbol_,
        string calldata baseURI_
    ) external initializer {
        __SBT_init(name_, symbol_);
        __Ownable_init(msg.sender);

        _setBaseURI(baseURI_);
    }

    function setBaseURI(string calldata newBaseURI_) external onlyOwner {
        _setBaseURI(newBaseURI_);
    }

    function batchMint(address[] calldata userAddresses_) external onlyOwner {
        for (uint256 i = 0; i < userAddresses_.length; i++) {
            _mint(userAddresses_[i], nextTokenId++);
        }
    }

    function tokenURI(uint256) public view override returns (string memory) {
        return baseURI();
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
        return
            interfaceId == type(IERC721Metadata).interfaceId ||
            interfaceId == type(IVerifiedSBT).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function _beforeTokenAction(address to_, uint256 tokenId_) internal virtual override {
        if (to_ == address(0)) {
            address tokenOwner_ = ownerOf(tokenId_);

            emit Transfer(tokenOwner_, address(0), tokenId_);
        } else {
            emit Transfer(address(0), to_, tokenId_);
        }
    }
}
